Ee vun de schnelle a nëtzlech Iessen fir de Menu du jour kann e Huetbrout bei séisser Rahm Sauce sinn, an enger Bratpfanne gekacht. De Vugel an eng cremeg Sauce gëtt déi beschte Firma Platen aus Geméis, Nuddelen oder Croup. Ausserdeem, duerch den neutralen Geschmaach vun der Sauce a Gefligel, kann dëse Geriicht kombinéiert ginn mat enger breeder Palette vu Gewierer an aner Additiven.
