- d 'Ernährung mat Fruucht, Geméis bezeechnen;
- frësche Mehl iessen (iessen 5 a kleng Portioune eemol pro Dag);
- net overeat;
- drénken e Glas Waasser virun Iessen a kleng Sips (fir 30 Minuten);
