- méi maachen (Walk for at least 1 Stonnen).
Gewiichtsverloscht fir de faulste - de beschte Wee fir séier a ouni Ustrengung fir eng Figur an der Rei ze setzen, Dir musst just wëll.
Mir wart op Är Fotoen a viru Schluss vu Gewiicht!
